import React from "react";
import "./Header.css";
import { Link } from "react-router-dom";
const Header = () => {
  return (
    <nav>
      <img src={require("./logo.jpeg")} alt="logo" />
      <Link to="/home">Home</Link>
      <Link to="/prices">Prices</Link>
      <Link to="/schedule">Schedule</Link>
    </nav>
  );
};

export default Header;
